import React, {Component} from 'react';
import './cell.css';
class Cell extends Component {
    render() {
        return (
            <div className={this.getClass()}>
                <span >
                    {this.props.cell.val}
                </span>
            </div>
        );
    }
    getClass = () =>{
        const { val, isVisiting,isChecking,isPrime} = this.props.cell;
        if(isPrime){
            return "cell cell-prime bg-dodgerblue text-light m-2";
        }else if( isVisiting ){
            return "cell cell-visiting m-2";
        } else if( isChecking ){
            return "cell cell-check m-2";
        } else{
            return "cell m-2";
        }
    }
}

export default Cell;
